import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1>Home Page</h1>
      <Link to="/seoin">
        <button>Seoin Page로 이동</button>
      </Link>
    </div>
  );
}

export default Home;
